import React from "react";
import Table from 'react-bootstrap/Table';
import {cancellation} from '../AirData';
import '../App.css';

const cancellations = (props) => {
    console.log(props);
    const keys = Object.keys(cancellation);
    return (
        <div>
            <Table bordered id = "table1">
                <thead>
                    <tr>
                        <th>Flight Code</th>
                        <th>Number of Cancellations</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        keys.map(data_key => (
                        <tr>
                          <td>{cancellation[data_key].flightCode}</td>
                          <td>{cancellation[data_key].cancelNo}</td>
                        </tr>
                    ))
                    }
                </tbody>
            </Table>
        </div>
    );
}
export default cancellations;
